  //
  function currentCirculatingSupply(){
    let circulatingSupply = '';
    let globalDate = (new Date()).toUTCString();
    globalDate = globalDate.split(' ');//['Sun,', '06', 'Sep', '2020', '07:14:06', 'GMT']
    //every: 碰到return false的时候，循环中止
    //some: 碰到return ture的时候，循环中止
    month_allocated.some((item, i) => {
      let v = item[0].split(' ');
      if(globalDate[2]+','+globalDate[3] == v[1]+v[2]){
        circulatingSupply = item[9];
        return true;
      }
    })
    return circulatingSupply;
  }
  //
  function yearCirculatingSupply(){
    var circulatingSupply = [];
    let globalDate = (new Date()).toUTCString();
    globalDate = globalDate.split(' ');//['Sun,', '06', 'Sep', '2020', '07:14:06', 'GMT']
    let year = ';'
    month_allocated.forEach((item, i) => {
      let v = item[0].split(' ');
      if(year != v[2]){
        year = v[2];
        circulatingSupply.push([item[0],item[9]]);
      }
    })
    return circulatingSupply;
  }
